import './web.css';

import React, { useEffect, useRef } from 'react';
import './web.css';

function Web() {
  const textRef = useRef(null);
  const phrases = ["Welcome to my portfolio.", "I'm a software developer.", "Let's build something amazing!"];
  let phraseIndex = 0;
  let letterIndex = 0;
  
  useEffect(() => {
    const typingInterval = setInterval(() => {
      if (letterIndex < phrases[phraseIndex].length) {
        textRef.current.textContent += phrases[phraseIndex].charAt(letterIndex);
        letterIndex++;
      } else {
        clearInterval(typingInterval);
        setTimeout(() => {
          eraseText();
        }, 2000); // Wait before erasing
      }
    }, 100);

    const eraseText = () => {
      const eraseInterval = setInterval(() => {
        if (letterIndex > 0) {
          textRef.current.textContent = textRef.current.textContent.slice(0, -1);
          letterIndex--;
        } else {
          clearInterval(eraseInterval);
          phraseIndex = (phraseIndex + 1) % phrases.length;
          setTimeout(() => {
            typeText();
          }, 500);
        }
      }, 50);
    };

    const typeText = () => {
      textRef.current.textContent = '';
      typingInterval = setInterval(() => {
        if (letterIndex < phrases[phraseIndex].length) {
          textRef.current.textContent += phrases[phraseIndex].charAt(letterIndex);
          letterIndex++;
        } else {
          clearInterval(typingInterval);
          setTimeout(() => {
            eraseText();
          }, 2000);
        }
      }, 100);
    };

    return () => clearInterval(typingInterval);
  }, [phrases]);

  return (
    <>
      <div className="container">
        <section id="home" className="section">
          <div className="title-container">
            <div className="title">
              <h1>ðŸ‘‹ Hi, welcome Anindita here.</h1>
            </div>
            <h2 className="typing-text">
              <span id="typed-text"></span>
              <span className="typed-cursor"></span>
            </h2>
          </div>
          <div className="social-links">
            <a href="https://www.linkedin.com/in/AninditaGhosh/" target="_blank" rel="noopener noreferrer">
              <i className="fab fa-linkedin"></i>
            </a>
            <a href="https://github.com/" target="_blank" rel="noopener noreferrer">
              <i className="fab fa-github"></i>
            </a>
            <a href="https://twitter.com/" target="_blank" rel="noopener noreferrer">
              <i className="fab fa-twitter"></i>
            </a>
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
              <i className="fab fa-facebook"></i>
            </a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <i className="fab fa-instagram"></i>
            </a>
          </div>
        </section>
      </div>

      <div className="sidebar">
        <a href="#home"><i className="fas fa-home"></i></a>
        <a href="#about"><i className="fas fa-info-circle"></i></a>
        <a href="#resume"><i className="fas fa-file-alt"></i></a>
        <a href="#portfolio"><i className="fas fa-briefcase"></i></a>
        <a href="#achievements"><i className="fas fa-trophy"></i></a>
        <a href="#contact"><i className="fas fa-envelope"></i></a>
      </div>

      <section id="about" className="section about">
        <h2>About Me</h2>
        <div className="about-content">
          <p>
            <b>Hello! I'm Anindita Ghosh, a passionate software developer with a love for learning and exploring new technologies. I am a beginner person in computer science and have worked on various projects ranging in web development.</b>
          </p>
          <p>
            <b>My journey in the tech world began with a curiosity to understand how things work, which led me to pursue a career in software development. Over the years, I have honed my skills in various programming languages and frameworks, and I'm always eager to take on new challenges and expand my knowledge.</b>
          </p>
          <p>
            <b>In my free time, I enjoy reading, hiking, and experimenting with new coding projects. I'm also an avid traveler and love exploring new cultures and cuisines.</b>
          </p>
        </div>
      </section>

      <section id="resume" className="section resume">
        <h1 align="center"><u>RESUME</u></h1>
        <div className="resume">
          <div className="resume-item">
            <div className="personal-info">
              <img src="anindita.jpg" alt="Anindita Ghosh" />
              <p align="justify" className="moral"><b>"If you can think, then you can create "</b></p>
              <p align="right" className="signature">~Anindita Ghosh</p>
            </div>
            <h3>Summary</h3>
            <p>As a prospective full-stack software engineer, I'm deeply passionate about developing scalable, high-performance, and reliable software systems.</p>
            <h3>Education</h3>
            <p><strong>Bachelor of Engineering in Information Technology (2022-2026)</strong><br />St. Thomas College of Engineering & Technology, Kolkata</p>
            <p><strong>Class 12th Board (2022)</strong><br />Dum Dum Ananda Ashram Sarada Vidyapith (WBCHSE)</p>
            <p><strong>Class 10th Board (2020)</strong><br />Baranagore Rajkumari Memorial Girl's High School (WBBSE)</p>
            <h3>Experience</h3>
            <p>Excited to announce that I've been selected for a Web Development Internship at IntechtechSoft Services Pvt Ltd! Looking forward to gaining knowledge and experience.</p>
          </div>

          <div className="resume-item">
            <h3>Skills</h3>
            <div className="skill-name"><i className="fab fa-python"></i> Python</div>
            <div className="skill-bar">
              <div className="skill-bar-fill python" style={{ width: '90%' }} data-label="90%"></div>
            </div>
            <div className="skill-name"><i className="fab fa-java"></i> Java</div>
            <div className="skill-bar">
              <div className="skill-bar-fill java" style={{ width: '85%' }} data-label="85%"></div>
            </div>
            <div className="skill-name"><i className="fab fa-html5"></i> HTML/CSS/JS</div>
            <div className="skill-bar">
              <div className="skill-bar-fill htmlcssjs" style={{ width: '80%' }} data-label="80%"></div>
            </div>
            <div className="skill-name"><i className="fab fa-laptop-code"></i> C</div>
            <div className="skill-bar">
              <div className="skill-bar-fill c" style={{ width: '75%' }} data-label="75%"></div>
            </div>

            <h3>Hobbies</h3>
            <ol>
              <li>Listening to Music</li>
              <li>Travelling</li>
              <li>Photography</li>
              <li>Exploring New Technologies</li>
            </ol>

            <div className="achievement-buttons">
              <p>To know More click ðŸ‘‡</p>
              <a href="certificate1.pdf" target="_blank" rel="noopener noreferrer">Resume</a>
            </div>
          </div>
        </div>
      </section>

      <section id="portfolio" className="section portfolio">
        <h5 align="left">Portfolio</h5>
        <div className="portfolio-content">
          <p align="center"><b>Here are some of my works:</b></p>
          <ol>
            <li><p>Tic Tac Toe game website (using HTML, CSS, JS): ðŸ‘‰<a href="tictactoe.html"><u>TicTacToe Game</u></a></p></li>
            <li><p>Student Admission form (using Python GUI): ðŸ‘‰<a href="form.jpg"><u>Student Form</u></a></p></li>
            <li><p>Calculator (using HTML, CSS, JS): ðŸ‘‰<a href="calculator.html"><u>Basic Calculator</u></a></p></li>
            <li><p>Income Tax Calculator (using HTML, CSS, JS): ðŸ‘‰<a href="incometaxcalculate.html"><u>Income Tax Calculator</u></a></p></li>
            <li><p>TO-DO-LIST (using HTML, CSS, JS): ðŸ‘‰<a href="todolist.html"><u>TO-DO-LIST </u></a></p></li>
          </ol>
        </div>
      </section>

      <section id="achievements" className="section achievements">
        <h5 align="left" className="uppercase">Achievements</h5>
        <p align="center"><b>Here are some of my Certificates:</b></p>

        <div className="achievement-buttons">
          <a href="certificate1.pdf" target="_blank" rel="noopener noreferrer">View Certificate 1</a>
          <a href="certificate2.pdf" target="_blank" rel="noopener noreferrer">View Certificate 2</a>
        </div>
      </section>

      <section id="contact" className="section contact">
        <div className="contact-form">
          <h5>CONTACT</h5>
          <p><i className="fas fa-envelope"></i> ganindita10@gmail.com</p>
          <p><i className="fas fa-phone"></i> +917980456257</p>
          <p><i className="fas fa-map-marker-alt"></i> 24/1, Rajendra Nath Chatterjee Road, Kolkata 700035</p>
          <form>
            <input type="text" placeholder="Your Name" />
            <input type="email" placeholder="Your Email" />
            <textarea placeholder="Your Message"></textarea>
            <button type="submit">Send</button>
          </form>
        </div>
      </section>
    </>
  );
}

export default Web;
